import React from 'react';
import MaterialTable from 'material-table';


export const Table=()=>{
    const data=[
        {name:'Hieu',age:'22'},
        {name:'Hieu',age:'23'},
        {name:'Hieu',age:'24'},
        {name:'Hieu',age:'25'},
    ]
    const columns=[
        {
            title:'Name', field:'name',
        },
        {
            title:'Age', field:'age'
        }
    ]
    return(
        <div>
            <MaterialTable title={"Dashboard Table"}
            data={data}
            columns={columns}
            options={{
                exportButton: true
            }}/>
        </div>
    )
}
